CREATE DEFINER=`root`@`localhost` PROCEDURE `check_stock`(
	/*product ID as parameter*/
    IN `itemID` INT,
    /*output*/
    OUT inStock TINYINT(1)
)
BEGIN
	DECLARE stockNum INT;
	DECLARE inStock VARCHAR(15);
	SELECT 
		stock.stock INTO stockNum
	FROM
		products INNER JOIN stock ON
        products.id = stock.itemID
	WHERE products.id = itemID;
    
    IF stockNum < 1 THEN 
		SET inStock = 'Out of Stock';
	ELSEIF stockNum > 1 THEN
		SET inStock = 'In Stock';
	END IF;
        
    SELECT inStock;
END ;;
